return (
    <Container>

    {/* <Container> */}
        {cardData.map((card,index) =>
    <Carousel autoPlay>
              <Card key={index}>
             <Image src={card.Image} alt="card"/>
             <QuoteIcon src={card.quoteIcon} alt="Icon"/>
             <p>{card.para}</p>
             <h1>{card.name}</h1>
             <h3>{card.title}</h3>
             </Card>
             </Carousel>
            )
        }      
{/* </Container> */}

             </Container>
)
}
